import React from 'react';
import './Schedule.css';
import ScheduleD from './ScheduleD';
import ScheduleW from './ScheduleW';
import Row from '.'

const Schedule = () => {
    return (
        <>
            <header>
                <p>Harmonogram zajęć</p>
            </header>
             <Row className="justify-content-md-center">>
                <ScheduleD />
                <ScheduleW />
            </Row>
        </>
    );
}

export default Schedule;
